cl-nsublis is an autoloaded compiled Lisp function in `cl-seq.el'.<br/><br/>(cl-nsublis ALIST TREE [KEYWORD VALUE]...)<br/><br/>Perform substitutions indicated by ALIST in TREE (destructively).<br/>Any matching element of TREE is changed via a call to `setcar'.<br/><br/>Keywords supported:  :test :test-not :key
